import React from 'react';
import Heading from '../Heading';
import { Row, Col, Image } from 'react-bootstrap';

function LandingSidebar() {
    return (
        <div>
            <Heading content="Similar Partners" style="h4 mb-4" />
            <Row>
                <Col xs={3} sm={3} md={4} lg={4}>
                    <Image
                        className="rounded-circle"
                        src="https://zom-in.com/images/profileimg/214041167_864501714481622_8310272007233828397_n.png"
                        fluid
                    />
                </Col>
                <Col xs={9} sm={9} md={8} lg={8} className="lh-1">
                    <p className="text-truncate mb-1">
                        <a href="rfg" className="link-dark text-decoration-none">TopNotch</a></p>

                    <span className="badge rounded-pill bg-info text-dark">Human Resource</span>
                </Col>
            </Row>
            <hr />
        </div>
    )
}

export default LandingSidebar;
